import React from 'react'
import { useState, useEffect } from "react";

function Home () {
  const [datas, setDatas] = useState([]);

  useEffect(() => {
    fetch('https://api.taddy.org/This American Life', {
      headers: {
        'Content-Type': 'application/json',
        "X-USER-ID": 706,
        "X-API-KEY": "71d748931a7cd592d4724deac9cabeb566291c1257d3da3e408d5a2628bd24d2794ba22f9d650f03f87aec6d072fc55f2f",
      }
    })
    .then((response) => response.json())
    .then((data) => { setDatas(data); })
    }, []);

    return (
      <div>
      <h3>Home</h3>
      <p>{datas}</p>
      </div>
    )
}

export default Home
